import Products from './product';
import Inventory from './inventory';
import Order from './order';
import OrderLine from './order-lines';

class App extends React.Component {

  render() {

    return(


      <Router>

        <nav className="navbar navbar-expand-lg bg-dark">
          <div className="">
            <a className="navbar-brand">Scout Inc. Warehouse</a>
          </div>


          <div className="collapse nav-collapse">
            <ul></ul>
          </div>

          <div className="nav-links mr-auto">
            <Link to="/bins" className="navbar-brand">Bins</Link>
            <Link to="/products" className="navbar-brand">Products</Link>
            <Link to="/inventory" className="navbar-brand">Inventory</Link>
            <Link to="/orders" className="navbar-brand">Orders</Link>
            <Link to="/order-lines" className="navbar-brand">Order Lines</Link>
          </div>

        </nav>

        <Route path='/bins' component={Bins} />
        <Route path='/products' component={Products} />
        <Route path='/orders' component={Order} />
        <Route path='/order-lines' component={OrderLine} />
        <Route path='/inventory' component={Inventory} />
